function Nav(){
	return(
		 <nav>
      <ul class="menu">
      
        <li>
        <i class="bi bi-house-fill"></i><Link to="/home" className="nav-link">Inicio</Link>
        </li>
        <li>
        <i class="bi bi-people-fill"></i><Link to="/quienessomos" className="nav-link">Quienes Somos</Link>
        </li>
        <li><a href="Portafolio.html"><i class="bi bi-journal-bookmark-fill"></i>Productos</a>
        </li>
        <li><a href="Contactenos.html" target="_self"><i class="bi bi-envelope-fill"></i>Contactenos</a></li>
      </ul>
    </nav>

		

		);
}
export default Nav;
